void PortF_Init(void){ 
	volatile unsigned long delay;
  SYSCTL_RCGC2_R |= 0x00000020;        // 1) F clock
  delay = SYSCTL_RCGC2_R;              // delay   
  GPIO_PORTF_CR_R |= 0x0A;             // allow changes to PF3      
  GPIO_PORTF_AMSEL_R &= ~0x0A;         // 3) disable analog function
  GPIO_PORTF_PCTL_R &= 0x00000000;     // 4) GPIO clear bit PCTL  
  GPIO_PORTF_DIR_R |= 0x0A;            // 5.2) PF3 output  
  GPIO_PORTF_AFSEL_R &= ~0x0A;         // 6) no alternate function
  GPIO_PORTF_DEN_R |= 0x0A;            // 7) enable digital pins PF4-PF0
  EnableInterrupts();                  // (i) Enable global Interrupt flag (I)
}

void EdgeCounter_Init(void){       
  SYSCTL_RCGC2_R |= 0x00000020;        // (a) activate clock for port F    
  GPIO_PORTF_DIR_R &= ~0x10;           // (c) make PF4 in (built-in button)
  GPIO_PORTF_AFSEL_R &= ~0x10;         //     disable alt funct on PF4
  GPIO_PORTF_DEN_R |= 0x10;            //     enable digital I/O on PF4
  GPIO_PORTF_PCTL_R &= ~0x000F0000;    //    configure PF4 as GPIO
  GPIO_PORTF_AMSEL_R &= ~0x10;         //    disable analog functionality on PF4
  GPIO_PORTF_PUR_R |= 0x10;            //     enable weak pull-up on PF4
  GPIO_PORTF_IS_R &= ~0x10;            // (d) PF4 is edge-sensitive
  GPIO_PORTF_IBE_R &= ~0x10;           //     PF4 is not both edges
  GPIO_PORTF_IEV_R &= ~0x10;           //     PF4 falling edge event
  GPIO_PORTF_ICR_R = 0x10;             // (e) clear flag4
  GPIO_PORTF_IM_R |= 0x10;             // (f) arm interrupt on PF4
  NVIC_PRI7_R = (NVIC_PRI7_R&0xFF00FFFF)|0x00A00000; // (g) priority 5
  NVIC_EN0_R = 0x40000000;             // (h) enable interrupt 30 in NVIC
  EnableInterrupts();                  // (i) Enable global Interrupt flag (I)
}

void GPIOPortF_Handler(void){
  GPIO_PORTF_ICR_R = 0x10;             // acknowledge flag4
  sp_wepon_ready ^= 0x08;
}

void Switchs_Interrupt(void)
{
	volatile unsigned long delay;
	SYSCTL_RCGC2_R |= 0x00000010;        // 1) F clock
  delay = SYSCTL_RCGC2_R;              // delay   
  GPIO_PORTE_DIR_R &= ~0x03;           // 2) make PE2 input
	GPIO_PORTE_AFSEL_R &= ~0x03;         // 3) disable alternate function on PE(0-1)
	GPIO_PORTE_DEN_R |= 0x03;            // 4) enable digital I/O on PE2
  GPIO_PORTE_AMSEL_R &= ~0x03;         // 5) disable analog function
  GPIO_PORTE_PCTL_R &= ~0X03;          // 6) GPIO clear bit PCTL  
  GPIO_PORTE_DEN_R |= 0x03;            // 7) enable digital pins PF4-PF0   
  GPIO_PORTE_IS_R &= ~0x03;            // 8) PE0 & PE1 are edge-sensitive	
	GPIO_PORTE_IBE_R &= ~0x03;           // 9) PE0 & PE1 are not both edges
	GPIO_PORTE_IEV_R |= 0x03;            // A) PE0 & PE1 rising edge event
	GPIO_PORTE_ICR_R = 0x03;             // B) clear flag4
	GPIO_PORTE_IM_R |= 0x03;             // C) arm interrupt on PE0 & PE1
	NVIC_PRI0_R = (NVIC_PRI1_R&0xFFFFFF0F)|0x000000F0;  // D) priority 5
	NVIC_EN0_R = 0x00000010;             // E) enable interrupt 1 in NVIC
	EnableInterrupts();                  // F) Enable global Interrupt flag (I)
}
void Vibration_motor_init(void)
{
	volatile unsigned long delay;
	SYSCTL_RCGC2_R |= 0x00000010;        // 1) E clock
  delay = SYSCTL_RCGC2_R;              // delay   
  GPIO_PORTE_DIR_R |= 0x20;            // 2) make PE0 & PE1 & PE4 input
	GPIO_PORTE_AFSEL_R &= ~0x20;         // 3) disable alternate function on PE(0-1-4)
	GPIO_PORTE_DEN_R |= 0x20;            // 4) enable digital I/O on PE0 & PE1 & PE4
  GPIO_PORTE_AMSEL_R &= ~0x20;         // 5) disable analog function
  GPIO_PORTE_PCTL_R &= ~0x20;          // 6) GPIO clear bit PCTL  
}
