void PortA_Init(void){ 
	volatile unsigned long delay;
  SYSCTL_RCGC2_R |= 0x00000001;        // 1) A clock
  delay = SYSCTL_RCGC2_R;              // delay   
	GPIO_PORTA_PCTL_R &= ~0x0000F000;    // configure PA3 as GPIO
  GPIO_PORTA_CR_R |= 0x08;             // allow changes to PA3      
  GPIO_PORTA_AMSEL_R &= ~0x08;         // 3) disable analog function 
  GPIO_PORTA_DIR_R |= 0x08;            // 5.2) PA4 output
  GPIO_PORTA_DR8R_R |= 0x08;           // enable 8 mA drive on PA3  
  GPIO_PORTA_AFSEL_R &= ~0x08;         // 6) no alternate function
  GPIO_PORTA_DEN_R |= 0x08;            // 7) enable digital pins PA4
}

void SysTick_Init(unsigned long period){
	Player.x = 56;
  Player.y = 127;
	rate = 0;
	NVIC_ST_CTRL_R = 0;                                        // Disable SysTick during setup
  NVIC_ST_RELOAD_R = (80000000/period) - 1;                  // Reload value
  NVIC_ST_CURRENT_R = 0;                                     // Any write to current clears it
  NVIC_SYS_PRI3_R = (NVIC_SYS_PRI3_R&0x00FFFFFF)|0x20000000; // Priority 1      
  NVIC_ST_CTRL_R = 0x0007;                                   // Enable SysTick with core clock and interrupts
}


unsigned char Map(unsigned long B_upper, unsigned long B_lower, unsigned long A_upper, unsigned long A_lower, unsigned long Value){
	long Nom;
	long Dom;
	long mapped;
	Nom = (B_upper - B_lower);
	Dom = (A_upper - A_lower);
	mapped = Nom * (Value - A_lower);
	mapped /= Dom;
	mapped += B_lower;
	return mapped;
}


