void Kill_sprite(int i){
	Enemy[i].life = dead;
	Enemy[i].regenerated = no;
	X_co = Enemy[i].x;
  Y_co = Enemy[i].y;
	Sound_Killed();
	Small_Explosion();
	//Explosion(i);
	Enemy_exploded[i] = yes;
	Player.score += 2;
	power_meter += 1;
} 

void Kill_Boss(int i){
	if(Boss_exploded[i] == no && Boss[i].life == dead){
		if(B_frame < 12){
			X_co = Boss[i].x;
			Y_co = Boss[i].y;
		  Small_Explosion();
			X_co = Boss[i].x + 13;
			Y_co = Boss[i].y;
		  Small_Explosion();
			X_co = Boss[i].x + 13;
			Y_co = Boss[i].y - 13;
		  Small_Explosion();
			X_co = Boss[i].x;
			Y_co = Boss[i].y - 13;
		  Small_Explosion();
			X_co = Boss[i].x - 7;
			Y_co = Boss[i].y + 7;
		  Small_Explosion();
			X_co = Boss[i].x - 7;
			Y_co = Boss[i].y - 34;
		  Small_Explosion();
			X_co = Boss[i].x + 34;
			Y_co = Boss[i].y - 34;
		  Small_Explosion();
			X_co = Boss[i].x + 34;
			Y_co = Boss[i].y - 7;
		  Small_Explosion();
		}
		if(B_frame >= 12 && B_frame < 24){
			X_co = Boss[i].x;
			Y_co = Boss[i].y;
		  BigExplosions1(i);
			X_co = Boss[i].x + 13;
			Y_co = Boss[i].y;
		  BigExplosions1(i);
			X_co = Boss[i].x + 13;
			Y_co = Boss[i].y - 13;
		  BigExplosions1(i);
			X_co = Boss[i].x;
			Y_co = Boss[i].y - 13;
		  BigExplosions1(i);
			X_co = Boss[i].x - 7;
			Y_co = Boss[i].y + 7;
		  BigExplosions1(i);
			X_co = Boss[i].x - 7;
			Y_co = Boss[i].y - 34;
		  BigExplosions1(i);
			X_co = Boss[i].x + 34;
			Y_co = Boss[i].y - 34;
		  BigExplosions1(i);
			X_co = Boss[i].x + 34;
			Y_co = Boss[i].y - 7;
		  BigExplosions1(i);
			if(B_frame >= 24){
			  Sound_Explosion();
				Boss_exploded[i] = yes;
				B_frame = 0;
			}
		}
		  B_frame++;
	}		
} 

