void Respawn(void){
	if(Player.Respawning_time <= 60){
	if(Player.Respawning_time % 2 == 0){
	
		ST7735_DrawBitmap(Player.x+1,Player.y -3,Playermain, 14, 7);
    ST7735_DrawBitmap(Player.x+4,Player.y -2,Player_tail_base, 8, 1);
		ST7735_DrawBitmap(Player.x+3,Player.y -1,Player_left_tail, 3, 1);
		ST7735_DrawBitmap(Player.x+10,Player.y -1,Player_right_tail, 3, 1);
		ST7735_DrawBitmap(Player.x+2,Player.y,Player_tail, 4, 1);
		ST7735_DrawBitmap(Player.x+10,Player.y,Player_tail, 4, 1);
		ST7735_DrawBitmap(Player.x,Player.y - 4,Playerwings, 1, 4);
		ST7735_DrawBitmap(Player.x+15,Player.y - 4,Playerwings, 1, 4);
		ST7735_DrawBitmap(Player.x+3,Player.y - 9,Player_left_rail, 2, 5);
		ST7735_DrawBitmap(Player.x+11,Player.y - 9,Player_right_rail, 2, 5);
		ST7735_DrawBitmap(Player.x+4,Player.y -14,Playertip, 1, 1);
		ST7735_DrawBitmap(Player.x+11,Player.y -14,Playertip, 1, 1);
	    
    }
  }
	Player.Respawning_time ++;
	if(Player.Respawning_time > 60){
		Player.Respawning_time = 0;
		Player.Respawining = no;
	}
}
void Draw_player(void){
	
	if (Player.health > dead && Player.Respawining == no && Player.lives > 0)
	{
		ST7735_DrawBitmap(Player.x+1,Player.y -3,Playermain, 14, 7);
    ST7735_DrawBitmap(Player.x+4,Player.y -2,Player_tail_base, 8, 1);
		ST7735_DrawBitmap(Player.x+3,Player.y -1,Player_left_tail, 3, 1);
		ST7735_DrawBitmap(Player.x+10,Player.y -1,Player_right_tail, 3, 1);
		ST7735_DrawBitmap(Player.x+2,Player.y,Player_tail, 4, 1);
		ST7735_DrawBitmap(Player.x+10,Player.y,Player_tail, 4, 1);
		ST7735_DrawBitmap(Player.x,Player.y - 4,Playerwings, 1, 4);
		ST7735_DrawBitmap(Player.x+15,Player.y - 4,Playerwings, 1, 4);
		ST7735_DrawBitmap(Player.x+3,Player.y - 9,Player_left_rail, 2, 5);
		ST7735_DrawBitmap(Player.x+11,Player.y - 9,Player_right_rail, 2, 5);
		ST7735_DrawBitmap(Player.x+4,Player.y -14,Playertip, 1, 1);
		ST7735_DrawBitmap(Player.x+11,Player.y -14,Playertip, 1, 1);
	if(stage_counter < 50){
		if( position_y >= 126){
			ST7735_DrawChar(Player.x, (Player.y - PLAYERH) , (Player.lives + 0x30), ST7735_WHITE, Background_color, 1);
		}
		else{
		  ST7735_DrawChar(Player.x, Player.y, (Player.lives + 0x30), ST7735_WHITE, Background_color, 1);
		}
	}
}
	else if ((Player.health <= dead && (Player.lives - 1) != 0) || Player.Respawining == yes){
		Player.Respawining = yes;
		Respawn();                            
		if( Player.y >= 126){
			ST7735_DrawChar(Player.x, (Player.y - PLAYERH) , (Player.lives + 0x30), ST7735_WHITE, Background_color, 1);
		}
		else{
		  ST7735_DrawChar(Player.x, Player.y, (Player.lives + 0x30), ST7735_WHITE, Background_color, 1);
		}
		if(Player.health <= dead){
			//Player.lives -= 1;
			Player.health = Player_Max_health;
		  Player.life = alive;
		}
	}
	
	else if (Player.life<=dead && (Player.lives - 1) == 0){
		//Player.lives -= 1;
		Fight_begun = no;
		Kill_Player();
		Delay100ms(250);
		Losing_screen();
	}
	
}
