void UART3_Handler(void) {
	UART3_ICR_R &= ~(0X010);
	rx_data = UART3_DR_R;
	if(rx_data >= 131 && rx_data <= 240){
	  M_Acc_x = rx_data - 128;
	}
	if(rx_data < 131 && rx_data >= 27){
	  M_Acc_y = rx_data;
	} 
	if(rx_data == 1){
	  A_button = 1;
	} 
	if(rx_data == 2){
	  B_button = 1;
	} 
	if(rx_data == 3){
	  A_button = 0;
	} 
	if(rx_data == 4){
	  B_button = 0;
	} 
} 

